import { useNavigate } from 'react-router-dom';

function Login() {
    let email=useRef();
    let pass=useRef();
    let move=useNavigate()
    function f1(e){
        e.preventDefault()
        let a=email.current.value;
        let b=pass.current.value;
        console.log(a,b);
        if(a==="" || b===""){
            window.alert("Please enter all the credentials")
        }
        else if(a==="hari@gmail.com" && b==="123"){
            move("/main")
        }
        else{
            alert("Wrong credentials")
        }

    }
  return (
    <>
        <h1>Welcome to login page</h1>
        <form action="" onSubmit={f1}>
            <input type="text" placeholder='Enter Email' ref={email} />
            <input type="password" placeholder='Enter password' ref={pass}/>
            <button type="submit">Submit</button>
        </form>
    </>
  )
}

export default Login
